const Task = (props) =>{
    const iportant = {
        color: 'red',
    }
    const {text, date, id, active} = props.task


    return (
       <div>
           <p>
               <strong>{text}</strong> - <span>{date} </span>
               <button onClick={() => props.change(id)}>Completed</button>
               <button onClick={() => props.delete(id)}>X</button> 
           </p>


       </div>
    )
}

export default Task
